            <Route exact path="/">
                <Ads/>
            </Route>
            {/*<Route path="/ad">*/}
            {/*    <AdForm/>*/}
            {/*</Route>*/}
            <Route path="/ad/:id">
                <SingleAd/>
            </Route>
        </Switch>
    </main>
)
